        mHdltvoutHandle << " , " <<  " \"temp_address0\" :  \"" << temp_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"temp_ce0\" :  \"" << temp_ce0.read() << "\" ";
